import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find the first "Add to Cart" button
    const addToCartButton = page.locator('.add-to-cart').first();
    await addToCartButton.waitFor({ state: 'visible', timeout: 5000 });

    // Screenshot before clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_before_add_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_before_add_to_cart.png'));

    // Click the "Add to Cart" button
    await addToCartButton.click();

    // Wait for the success notification to appear
    const notification = page.locator('.notification.success');
    await notification.waitFor({ state: 'visible', timeout: 5000 });

    // Screenshot after adding to cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_add_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_add_to_cart.png'));

    // Extract data for verification
    const notificationText = await notification.textContent();
    const cartText = await page.locator('.cart').textContent();

    return {
      success: true,
      action: "Clicked the 'Add to Cart' button for the first product and verified the success notification.",
      extractedData: {
        notificationText: notificationText.trim(),
        cartText: cartText.trim().replace(/\s+/g, ' ')
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add the first product to the cart.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
